('node', 'price', 0, 34, 34, 'und', 0, '<strong>Keep it simple. One package, one price.</strong>\r\n\r\n<strong>With o&c you get:-</strong>\r\n\r\nA pre-wedding shoot or 10 8×12 prints from your wedding.\r\n\r\nTwo photographers for 8 hours on your wedding day.\r\n\r\nA disc of all your images to print as many times as you want.\r\n\r\nAn online gallery to show your friends and family.\r\n\r\n<strong>All for £1650</strong>\r\n\r\nAdditional hours £100 per hour.\r\nPlease contact us for international wedding bookings.', '', 'full_html'),
('node', 'how_we_work', 0, 37, 37, 'und', 0, 'We like capturing the moment not creating it. We are relaxed people and put our couples at ease letting us take natural and real photographs. Our work is clean and organic and makes photos that have a timeless feel that tells your story. We love happy photos that are full of joy and emotion.\r\n\r\nWe are not in your face photographers, and always remember that it’s your wedding day not our photoshoot. We like to build a rapport with our couples beforehand and get to know how they work, what they like and what they don’t like, so we can have fun on the day getting them the pictures that they want. We want our couples to feel comfortable to be themselves and have fun having their photos taken.\r\n\r\nOur desire is that you are truly excited about your wedding day and if you are after special images that retell that fun, love and laughter we might just be the photographers for you!', '', 'filtered_html'),
('node', 'wp_blog', 0, 170, 170, 'und', 0, 'Chris and Alana were married in the beautiful Pembrokeshire town of Newport. Such a quaint and pretty place. They held their ceremony and reception at Llys Meddig.  They had their evening celebration at the local town hall, which they decorated and styled around their garden party inspiration. One of the most uplifting things about this wedding day, apart from Chris and Alana getting married (obviously!) was that these guys had made their day their own. It wasn''t an expensive day in comparison to some weddings, but it was thought about and dreamt about and each touch was special to them. There were "View-masters" on each table with photos of Chris and Alana for the guests to scroll through , (while reminiscing about playing with View-masters in their own childhood - love those things!) flowerpots full of cheesecake, cunningly disguised as soil (ingenious!) and beautiful arrival drinks full of edible flowers. \r\n\r\nWhat gave us such a buzz and to be honest, always does, is watching our couple interact with one another on their big day, particularly when we have the honour of capturing couple shots. Watching Chris and Alana take on board the super-awesome moment that had just happened, seeing their true characters shine through and the deep love and respect that they have for each other. Thats flippin'' wonderful! (WE LOVE OUR JOB!) Thank you so much for allowing us to share in your day. We loved it xx o&c', '', 'filtered_html'),
('node', 'wp_blog', 0, 171, 171, 'und', 0, 'Matthew and Hayleys wedding was a perfect accumulation of love, deep friendship and family bonds with beautifully hand crafted details and choosing to embrace and make the most of the Welsh weather. Rain and fog didn''t stop the celebrations. If anything the amazing low fog that hung over the roads outside the King Arthur Hotel on the Gower were truly spectacular and made the perfect backdrop for some special shots between the ceremony and reception. Thank you for trusting us guys! We have to take our hat off to Hayley for the visual creation of the day. This girl is an absolute genius when it comes to crafting. Every inch of detail was thought about and made by her own fair hands. From tiny embroidered details with vintage influence, to the super cool ties and pocket chiefs for the boys to wear with their sharp suits, the design for the soft pink bridesmaid dresses and the personalised socks for the groom, his grooms men and the male guests at the wedding. (Hayley works for the amazing Corgi Hoseiry, sock maker extraordinaries) Being part of such a wonderful celebration, surrounded by Matthew and Hayleys friends and family was such an honour. Deep laughter and joy, respect and love hung in the air and literally eclipsed every moment. It was one of those weddings that had an impact on us, so much so, I remember clearly talking a large part of the journey home about the love and true respect that we had witnessed. You cant buy that! Thank you again lovely Mr & Mrs Egg! :P (Porch = Pouched = Egg!) Much love for making us smile inside and out! xx  o&c Thank you to Love My Dress blog for featuring this wedding on their blog too.  ', '', 'filtered_html'),
('node', 'wp_blog', 0, 188, 188, 'und', 0, 'One of the absolute highlights of 2013 was working alongside our lovely friend Amy Mair. Amy had been talking to us for a while about her plans for her debut collection and we knew from her amazing skills in dress making, painting, her sketch books and her eye for detail, colour and texture that the plans Amy had would be amazingly beautiful. When Amy asked if would be interested in shooting her debut collection we were pretty much blown away. The dresses were more beautiful than we imagined and her ideas for the shoot were so exciting, we knew that it would be both a real honour and privilege to capture these dresses. The  Freda-May collection is aptly named after Amys Nanan who sadly is no longer alive, but used to constantly encourage Amy to draw, create and express her abilities in art. With a large amount of experience, working with a top wedding dress designer and then going on to work at White Bride in Narbeth, Pembrokeshire, Amy has developed her design sklills  into stunning gowns that are truly worthy of being worn and cherished. We are so pleased to be able to share with you today the amazing work of our friend Amy Mair. Thanks for this shoot must go out to Amy and her amazing dresses Mallow, Lupin, Bluebell and Aster. To our wonderful model for the day Savanah. Thank you to Amrie for make up and to Nia, Rosie and Sally for all your help with carrying dresses, sheltering from crazy downpours, keeping members of the public off the bridge and gathering up everything that we needed. Also a huge shout out to the beautiful places where we shot the collection. Bosherston Lilly Ponds, Stackpole Quay and  the stunning nearby woodland. Pembrokeshire really does provide the most amazing back drop for a shoot like this and was totally appropriate and relevant to a collection dreamt up and crafted with inspiration from the Pembrokeshire coast. For more information about these stunning dresses and a chance to learn more about the lady behind these designs please do take time to have a look thet Amy Mair Couture site. Also thank you to Cwtch The Bride blog ans A Touch of Modern for sharing more of the Freda May Collection on their blogs too.', '', 'filtered_html'),
('node', 'wp_blog', 0, 189, 189, 'und', 0, 'Welcome to Hiltonbury, the wedding and 2 day celebration of the wonderful Rich and Kate. Two of the most genuinely lovely, amazingly talented and classy types, who have such open and honest hearts, we felt it a true honour to be invited to join them in their wedding festival. With teepees, yurts, bunting, hand-made pin-holes, big balloons, bow ties, amazing food, three bands, greenhouse, handmade pretty much everything, these guys celebrated in full on camping style. Its really hard to put into words the truly amazing skill, style and finesse with which this wedding was created. It was an absolute dream for us. Surrounded by so much fun, laughter and amazingly wonderful people. We hope the photos give you an idea of what we had to deal with. It was anything but an ordeal for us. Thank you so so much guys. We think youre pretty darn awesome! x We have to give a few shout outs to some of the other vendors involved in this wedding. We were pretty much buzzing from the skill and quality that we saw. With three bands over the 2 day celebration the musical entertainment was by far some of the best we have ever seen. We have to give a shout out to the three amazing bands and without a doubt, would recommend them to anyone looking for quality entertainment. The Chaps, The Retrosettes and iRock. The food at this wedding was exceptional too. Holy Moly! Go check out Greengages for an exquisite menu and also brilliant creativity and presentation. We have been inspired by their take on the burger thats for sure! Right, thats enough talking.... enjoy Hiltonbury in all its glory! x o&c', '', 'filtered_html'),
('node', 'wp_blog', 0, 190, 190, 'und', 0, 'So, one month before Christmas I would not have thought that I would have been posting this. My beautiful little sister and her wonderful FIANCE! Sheesh, this is going to be emotional! I cant speak more highly of these guys. Beautiful people inside and out with amazing hearts, giving and caring natures and a deep love for friends, family and God.Watching my little sis wait patiently for the right man has made me so proud and I cant thank Lester enough for being the one to fill those boots! We are so happy that you are part of our family. Owens first bro-in-law and another Uncle to add to Flossies collection! (Auntie Cezzie, youre still her favourite and only Auntie!!! :P) and a super happy sister too! There were big sneaky plans for their engagement and Lester kindly got us involved (we were going to be taking photos of the proposal)  but down to typical bad UK weather he had to change his plans. No less romantic and no less perfect, with a beautiful 9 diamond ring, placed inside a beautiful Christmas bauble Lester asked Ceri to be his wife and she said YES! On Christmas day, a few days after their engagement, after a large scrumptious meal, present giving and before we settled on down to watch movies and drink home-made gin, we popped up a snowy  Ceri Ridgeway (Near Newtown, Mid Wales). With their fabulous new headgear (nice hats peeps!) and direction from a big sister (ha!) here are some photos we captured to celebrate the start of something truly amazing. Thank you so much for allowing us to capture this amazing start of the journey and we cant wait to be part of your big day. We love you both, so hugely proud and cant wait to see what life as The Watsons has in store. xxxx O, Charis and Flossie-chops X', '', 'filtered_html'),
('node', 'wp_blog', 0, 191, 191, 'und', 0, '2013 has been a complete blast. We''ve laughed, we''ve cried, we''ve ooohed, we''ve ahhhed, we''ve sneaked, we''ve tweaked, we''ve embraced, we''ve admired, we''ve applauded, we''ve grooved, we''ve high fived, we''ve done so much and seen so much and adored everyone and everything we have had the honour of photographing.\r\n\r\nThank you wholeheartedly to all our couples who have chosen to trust us with your wedding photos. To the families who have allowed us to take a glimpse at how you live and do life. To the creative people who have chosen us to capture something of their dream.\r\n\r\nThank you hugely to those couples who have taken the time to complete questionnaires so our weddings could be blogged and shared with others.To the couples who took time to complete questions and wrote amazing things about us, which helped us win Best Wedding Photographer in West Wales 2013 (Yay and wowsers!)\r\n\r\nThank you to our wonderful family. To Tadcu & Mamgu and Pappa & Nanna and Auntie Cezzie for looking after our little lady so that we can do our job, knowing she is looked after and cared for X X X\r\n\r\nThank you to all those photographers and friends who have believed in us this year and have made the effort and taken the time to comment on our work, to chat to us and to give us a hugely appreciated thumbs up.\r\n\r\nThank you to Owen and Rik for getting our new website looking HOT and getting it up and out there.\r\n\r\nThank you to everyone who is just flippin'' brill! (here endeth the speech!)\r\n\r\nMuch love and Happy Christmas to you all. Heres looking forward to 2014, for new adventures, new challenges and whole lot more loveage & plenty of huggage  x x x o&c', '', 'filtered_html'),
('node', 'faq_panel', 0, 195, 195, 'und', 0, '<strong>How many photographers do I get?</strong>\r\nTwo! Owen and Charis at every wedding.\r\n<strong>What is a pre-wedding shoot?</strong>\r\nA 1-2 hour session in a location of your choice. Time to learn to relax in front of the camera before your big day and a chance for us to learn how you guys work. A time to have fun & a bit of a laugh together.\r\n<strong>How long do you stay for?</strong>\r\nOur standard time is 8 hours although more hours can be added.\r\n<strong>How far do you travel?</strong>\r\nTo the ends of the earth! [All travel expenses within the UK mainland are included]\r\n<strong>Can we meet you first?</strong>\r\nOf course. We offer every enquiry a free consultation where we come to you, and you get to meet us and see our work.\r\n<strong>Are you insured?</strong>\r\nYes! We have public liability coverage up to £10,000,000. Should your venue require, we can provide proof.', '', 'full_html'),
('node', 'faq_panel', 0, 196, 196, 'und', 0, '<strong>Do you take group shots?</strong>\r\nWe are happy to take the more formal group shots, but we do ask that you limit them to 8 and budget 3 mins per shot in your timings.\r\n<strong>Do you need a list of photos?</strong>\r\nWe only ask for a list of your 8 formal group shots just to make sure we get them. Other than that we capture your day as it happens.\r\n<strong>When will I get my photos?</strong>\r\nOur turn around is usually 6 weeks for your gallery to go live.\r\n<strong>How many photos will I get?</strong>\r\nWe provide a minimum of 350 images [usually 450-500] from your wedding day. These have all been processed on the computer and are ready for you to print should you so desire.\r\n<strong>Can I order prints and albums?</strong>\r\nWe have partnered with an album design and print studio called Print.Share.Love. who are brilliant and handle all our print products.\r\n<strong>What about the environment?</strong>\r\nWe have a green policy where we offset our entire carbon footprint by contributing to schemes on www.carbonfootprint.com', '', 'full_html'),
('node', 'faq_panel', 0, 197, 197, 'und', 0, '<strong>How do we book you?</strong>\r\n\r\nIf you are interested in booking us as your wedding photographers follow the steps below:\r\n\r\n1. Email hello@oacphotography.com to check that your date is available\r\n\r\n2. Book your consultation, a chance to meet up and chat through your plans\r\n\r\n3. If you like what you see sign our contract\r\n\r\n4. Pay your £450 deposit, which secures your date and “o&c” as your photographers!\r\n\r\n5. Breathe out, sit back, relax, make a cuppa and enjoy ticking off the “wedding photographer” box on your plans.\r\n\r\nOnce we have received your deposit your date is held exclusively for you.\r\n\r\nThe remaining balance must be paid in full by four weeks before your wedding.', '', 'filtered_html'),
('node', 'amigos', 0, 202, 202, 'und', 0, '<strong>Our Amigos</strong>\r\nThese are links to people who WE think are ACE! These are not links done for link exchange or our own gain, but for the reason that we believe in them. Without blinking we would recommend any of these fine people. We are truly privileged to call them friends or en Espanol; Amigos!', '', 'filtered_html'),
('node', 'amigos', 0, 203, 203, 'und', 0, '<strong>Wedding blogs</strong>\r\nWedding blogs are a great place to find ideas and inspiration for your day. These guys below curate the best blogs in the UK. Delve in and be inspired.\r\n\r\n<strong>Rock My Wedding:</strong> www.rockmywedding.co.uk\r\n\r\n<strong>Rock And Roll Bride:</strong> www.rocknrollbride.com\r\n\r\n<strong>Love My Dress:</strong> www.lovemydress.net\r\n\r\n<strong>Whimsical Wonderland Weddings:</strong> www.whimsicalwonderlandweddings.com\r\n\r\n<strong>Cwtch the Bride:</strong> www.cwtchthebride.com', '', 'filtered_html'),
('node', 'amigos', 0, 204, 204, 'und', 0, '<strong>Food and refreshments</strong>\r\nWe all like a good feed and these guys are out of this world good, and I mean out of this world!!! Go on! Give your guests a real treat.\r\n\r\n<strong>Owen Hall from Shindigz:</strong> Shindigz outside catering facebook page\r\n\r\n<strong>Matt from Greengages:</strong> www.gogreengages.com\r\n\r\n<strong>Tom from Holdens:</strong> www.holdenscatering.com\r\n\r\n<strong>Nick and Emma from the Coffee Camper:</strong> www.thecoffeecamper.com', '', 'filtered_html'),
('node', 'amigos', 0, 205, 205, 'und', 0, '<strong>Music</strong>\r\nThese bands will rock your socks off and are guaranteed to keep your guests on the dance floor. Based all over the country, and willing to travel.\r\n\r\n<strong>The Rebel Party Band:</strong> www.therebelpartyband.com\r\n\r\n<strong>iRock:</strong> www.irockband.co.uk\r\n\r\n<strong>Zen Hussies:</strong> www.zenhussies.com\r\n\r\n<strong>Symphony Sid and the Swing Kings:</strong> www.symphonysid.co.uk\r\n\r\n<strong>The Retrosettes:</strong> www.theretrosettes.com\r\n\r\n<strong>The Chaps:</strong> www.thechapsband.com', '', 'filtered_html'),
('node', 'amigos', 0, 206, 206, 'und', 0, '<strong>Venues</strong>\r\nWe’ve had the chance to photograph weddings at the most amazing places. Here are some of our favourites.\r\n\r\n<strong>Fforest:</strong> www.coldatnight.co.uk\r\n\r\n<strong>Hilton Court:</strong> www.hiltoncourt.co.uk\r\n\r\n<strong>Rhos y Gilwen:</strong> rhosygilwen.co.uk', '', 'filtered_html'),
('node', 'amigos', 0, 207, 207, 'und', 0, '<strong>Make up</strong>\r\nWe like make up that makes you look like you. These guys are amazing at what they do and know how to do it well.\r\n\r\n<strong>Debs from Planet Make up:</strong> www.planetmakeupblog.com\r\n\r\n<strong>Jennifer from Jennifer Mills:</strong> jensbeauty225@aol.com', '', 'filtered_html'),
('node', 'amigos', 0, 208, 208, 'und', 0, '<strong>Flowers</strong>\r\nFrom button holes to those massive flower display thingys!\r\n\r\n<strong>Miss Pickering:</strong> www.misspickering.com\r\n\r\n<strong>Amaryllis Flower Boutique:</strong> www.amaryllisflowerboutique.co.uk\r\n\r\n<strong>Hayford and Rhodes:</strong> www.hayfordandrhodes.co.uk', '', 'filtered_html'),
('node', 'amigos', 0, 209, 209, 'und', 0, '<strong>Dresses</strong>\r\nGetting your wedding dress is an experience in itself. These guys are not just great at helping you choose the right gown, but make the whole experience an event to remember.\r\n\r\n<strong>Sally at White Bride:</strong> www.whitebride.net\r\n\r\n<strong>Amy Mair Couture:</strong> www.amymaircouture.co.uk\r\n\r\n<strong>Fur Coat No Knickers:</strong> www.furcoatnoknickers.co.uk', '', 'filtered_html'),
('node', 'amigos', 0, 210, 210, 'und', 0, '<strong>Video</strong>\r\nWe all know photos are where its at, but these videographers are pretty damn hot! Check out their work.\r\n\r\n<strong>Ben from Ben Walton Films:</strong> www.benwaltonfilms.co.uk\r\n\r\n<strong>Lee and Dawn from Shutterbox Films:</strong> www.shutterboxfilms.co.uk\r\n\r\n<strong>Si from Simon Clarke Films:</strong> www.simonclarkefilms.com', '', 'filtered_html'),
('node', 'about_us', 0, 211, 211, 'und', 0, 'I’m Charis (pronounced Ca-ris). I’m three quarters welsh, grew up in Birmingham, studied in Suffolk, trained in Oxford, married a Welsh man and now living in Pembrokeshire.I love taking photos, I always have. I also love learning from others, trying to get that bit better, all the time.\r\n\r\nMy camera pretty much travels with me now.I love capturing moments, making photos fun and getting totally wrapped up in beautiful things.I’m a sucker for detail and get so excited when I find something that grabs my attention... I cant put it off, I have to take a photo!I’m married to my best friend who happens to be an amazing photographer, so my job is always fun!\r\n\r\nWorking as a team with your best mate is excellent. We understand each other and bounce of each other, yet we are so different and complement each other in the way we say, think and do things. Life is always fun with a husband like mine!\r\n\r\nWhen I’m not taking photos I enjoying creation in other ways. I love singing..all the time, I love walking and taking in fresh air, I love our friends&family. I’m crazy for great fabric, ribbons and things and get a buzz from making.\r\n\r\nI''ve been a teacher and loved it, but fancied a change. Children always make me smile...oh, to be that innocent, its something that can never be over-rated!That''s me, I hope what you see is what you get, if not tell me :)', '', 'filtered_html'),
('node', 'about_us', 0, 212, 212, 'und', 0, 'I am the downhill tumble and roll champ, King of the  toad finders, Captain of the high altitude tree branch vista club, Second place finisher in the round the yard backwards dash, Premier burper state division, Snodbuster and worm scout first order and Generalisimo of the mud and mayhem society! Oh, and I really really like taking pictures! I have been doing it since I was ten years old on my solid-as-the-Russian-tank-it-was-made-from Zenit EM and then professionally since early 2007.  I have my dream job and love doing it.\r\n\r\nI grew up in Pembrokeshire where I now live with my incredible wife. Living in such an stunningly beautiful place is a massive inspiration. I am big into the outdoors whether walking, surfing, kite boarding, sailing, climbing, and sand castle building! I try to play the drums and guitar too.\r\n\r\nWhen not taking photos I can be found doing one of the above or hanging out, laughing and eating with some good friends.I also am a big Calvin and Hobbes fan and that’s who I borrowed my first paragraph from.  Thank you Mr. Watterson.\r\n', '', 'filtered_html'),
('node', 'about_us', 0, 213, 213, 'und', 0, 'Text goes here', '', 'filtered_html');
